            fontStyle: "italic",
            textDecorationLine: "underline",
            color: "#2980b9",
          }}
        >
          product
        </Text>
      </Text>
    </View>
  );
};

// Tạo biến chứa và css
const styles = StyleSheet.create({
  text: {
    marginTop: 50,
    textAlign: "center",
    fontSize: 30,
    fontWeight: "bold",
    textTransform: "uppercase",
  },
});

export default DetailsScreen;
